var script_f1_17_1298=[" /* <![CDATA[ */",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function SerumAnionGap_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 3000);",
"",
"with(document.SerumAnionGap_form){",
"",
"",
"doCalc = true;",
"if (Na_param.value.indexOf(',') >= 0){ Na_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Na_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"Na = param_value;",
"if (Cl_param.value.indexOf(',') >= 0){ Cl_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Cl_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"Cl = param_value;",
"if (HCO3_param.value.indexOf(',') >= 0){ HCO3_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(HCO3_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"HCO3 = param_value;",
"dp = decpts.options[decpts.selectedIndex].text;",
"Serum_AG =  Na - (Cl + HCO3);",
"",
"if (doCalc) Serum_AG_param.value = fixDP(Serum_AG, dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.SerumAnionGap_form){",
"",
"if (Na_param.value && Na < 80) {",
"Na = 0;",
"Na_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Na is 80 meq/L.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Na_param.value && Na > 200) {",
"Na_param.value = \"\";",
"clrResults();",
"Na = 0;",
"doCalc = false;",
"alert(\"The maximum value for Na is 200 meq/L.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Cl_param.value && Cl < 60) {",
"Cl = 0;",
"Cl_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Cl is 60 meq/L.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Cl_param.value && Cl > 180) {",
"Cl_param.value = \"\";",
"clrResults();",
"Cl = 0;",
"doCalc = false;",
"alert(\"The maximum value for Cl is 180 meq/L.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.SerumAnionGap_form){",
"",
"Serum_AG_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"/* ]]> */"].join("\n");
